import React, { useEffect } from 'react'
import {Link} from 'react-router-dom'

const MeetPage = ({setIsMeet}) => {
    useEffect(()=>{
        setIsMeet(true)
    },[])
  return (
    <div>
      <h1>Meet Room</h1>
      
      <button onClick={()=>setIsMeet(false)}>Leave</button>
    </div>
  )
}

export default MeetPage
